
import base64
from cryptography.fernet import Fernet

def decoder_base64(encoded_text):
    return base64.b64decode(encoded_text).decode('utf-8')

def dechiffrer_fernet(texte_chiffre, cle):
    fernet = Fernet(cle)
    return fernet.decrypt(texte_chiffre.encode('utf-8')).decode('utf-8')

